import './Nav.css';

import search from './img/search.svg'


function Nav() {
    return (
        <div className="App">
        <div className='nav_left'>
            <div>
                <ul>
                    <li><p></p></li>
                    <li>NEW</li>
                    <li>WOMEN</li>
                    <li>MEN</li>
                    <li>ART OF LIVING</li>
                    <li>MAGAZINE</li>
                </ul>
            </div>
        </div>
        <div className='nav_right'>
SEARCH
        </div>
        </div>
    );
}

export default Nav;
